import { MongoClient } from 'mongodb';

class DBClient {
  constructor () {
    const host = process.env.DB_HOST? process.env.DB_HOST :'localhost';
    const port = process.env.DB_PORT? process.env.DB_PORT :'27017 ';
    const database = process.env.DB_DATABASE? process.env.DB_DATABASE :'files_manager';
    const url = `mongodb://${host}:${port}`;

    (async () => {
      const client = new MongoClient(url, { useUnifiedTopology: true });
      await client.connect();
      this.isConnected = true;
      this.db = await client.db(database);
    })()
    .then(this.isConnected = true)
    .catch(this.isConnected = false);
  }

  isAlive() {
    return this.isConnected;
  }

  async nbUsers() {
    return await this.db.collection('users').countDocuments();
  }

  async nbFiles() {
    return await this.db.collection('files').countDocuments();
  }

  async uploadUser(user) {
    await this.db.collection('users').insertOne(user);
  }

  async uploadFile(file) {
    return await this.db.collection('files').insertOne(file);
  }

  async findUser(filter) {
    if (filter._id) {
      let usersFound = [];
      if (Object.keys(filter).length > 1) {
        const _filter = JSON.parse(JSON.stringify(filter));
        delete _filter._id;
        usersFound = await this.db.collection('users').find(_filter).toArray();
      } else {
        usersFound = await this.db.collection('users').find({}).toArray();
      }
      const user = usersFound.filter((value) => {
        return filter._id === value._id.toString();
      });
      if (user.length === 1) {
        user[0].id = user[0]._id;
        delete user[0]._id;
        return user[0];
      } else {
        return {};
      }
    }
    return await this.db.collection('users').find(filter).toArray();
  }

  async findFile(filter) {
    if (filter._id) {
      let filesFound = [];
      if (Object.keys(filter).length > 1) {
        const _filter = JSON.parse(JSON.stringify(filter));
        delete _filter._id;
        filesFound = await this.db.collection('files').find(_filter).toArray();
      } else {
        filesFound = await this.db.collection('files').find({}).toArray();
      }
      const file = filesFound.filter((value) => {
        return filter._id === value._id.toString();
      });
      if (file.length === 1) {
        file[0].id = file[0]._id;
        delete file[0]._id;
        return file[0];
      } else {
        return {};
      }
    }
    return await this.db.collection('files').find(filter).toArray();
  }

  async findFiles(userId, parentId, page, size) {
    console.log(userId, parentId, page, size)
    const files = await this.db.collection('files').aggregate([
      {'$match': {'userId': userId, 'parentId': parentId}},
      {'$sort': {'type': 1, 'name': 1}},
      {'$skip': page * size},
      {'$set': {'id': '$_id'}},
      {'$limit': size},
      {'$project': {'_id': 0, 'localPath': 0}}]);
    console.log(await files.toArray());
    return await files.toArray();
  }
}

const dbClient = new DBClient();
module.exports = dbClient;

